import React from "react";
// import "./MehreenStyles.css"
import ReactBootstrap, {Nav, Button, Navbar,NavDropdown,Form,FormControl} from 'react-bootstrap';
import 'bootstrap/dist/css/bootstrap.min.css';
// import Scrollchor from 'react-scrollchor';
import GuestLinks from './guestlinks';
import LoginLinks from './loginlinks';
import firebase from './firebase';

function Header(props) {
	if(!firebase.getCurrentUsername()) {
		// not logged in
		alert('Please login first')
		props.history.replace('/login')
		return null
	}
    return (
        <div>
        <Navbar className="nav-link" expand="lg">
      
          <Navbar.Toggle aria-controls="basic-navbar-nav" />
          <Navbar.Collapse id="basic-navbar-nav">
          <a style={{background: "#955F61",color: "white"}} class="navbar-brand" href="/">Khana Shana </a>
           {links}
          </Navbar.Collapse>
        </Navbar>
      </div>
    );
}

const mapStateToProps = (state) => {
  return {
    auth:state.firebase.auth
  }
}

export default Header;
